const NewContact = ({
    handleSubmit, contactName, setcontactName, contactPhoneNumber, setcontactPhoneNumber,contactEmail,setcontactEmail
}) => {
    return (
        <main className="NewContact">
            <h2>New Contact</h2>
            <form className="newPostForm" onSubmit={handleSubmit}>
                <label htmlFor="postTitle">Name:</label>
                <input
                    id="postTitle"
                    type="text"
                    required
                    value={contactName}
                    onChange={(e) => setcontactName(e.target.value)}
                />
                <label htmlFor="postBody">PhoneNumber:</label>
                <input
                    id="postBody"
                    required
                    value={contactPhoneNumber}
                    onChange={(e) => setcontactPhoneNumber(e.target.value)}
                />
                 <label htmlFor="postBody">email:</label>
                  <input
                    id="postBody"
                    required
                    value={contactEmail}
                    onChange={(e) => setcontactEmail(e.target.value)}
                />
                <button type="submit">Submit</button>
            </form>
        </main>
    )
}

export default NewPost
